import React from "react";
import { Link } from "react-router-dom";

function TagList({ tags }) {
  console.log(tags);
  return (
    <div className="tag-list">
      {tags.map((tag) => {
        return (
          <p className="secondary primary-bg badge" key={tag}>
            {tag}
          </p>
        );
      })}
    </div>
  );
}

export default TagList;
